import React from 'react';
import { useParams } from 'react-router-dom';

function Page() {
  const { machineId } = useParams();

  const machineData = [
    {
      id: 1,
      img: 'path/to/image1.jpg',
      title: 'Power grading system',
      description: 'This page provides information about the power grading system.',
    },
    {
      id: 2,
      img: 'path/to/image2.jpg',
      title: '150 kvar APFC Panel',
      description: 'Detailed information about the 150 kvar APFC Panel.',
    },
    // Add other machines here...
  ];

  const selectedMachine = machineData.find((machine) => machine.id === parseInt(machineId, 10));

  if (!selectedMachine) {
    return <div>Machine not found!</div>;
  }

  return (
    <div>
      <h1>{selectedMachine.title}</h1>
      <img src={selectedMachine.img} alt={selectedMachine.title} />
      <p>{selectedMachine.description}</p>
    </div>
  );
}

export default Page;
